export class User {
  full_name: any;
  username: any;
  password: any;
  role: any;
  email: any;
  tel: any;
  info: any;
  conditions: any;

  constructor(
    username: any,
    password: any,
    role: any,
    email: any,
    civilStatus: any,
    gender: any,
    info: any,
    conditions: any
  ) {
    this.full_name = username;
    this.username = password;
    this.password = role;
    this.role = email;
    this.email = civilStatus;
    this.tel = gender;
    this.info = info;
    this.conditions = conditions;
  }
}
